> Florida No longer patient, Bush backers fret about sluggish campaign FILE - In this Oct. 6, 2015, file photo, Republican presidential candidate Jeb Bush waits on stage in Davenport, Iowa. For months, Bush’s campaign insisted it was too early. But with just over three months until primary voting gets underway in Iowa, and Bush still mired in the middle of the crowded GOP field, some supporters fear it could soon be too late. (AP Photo/Charlie Neibergall, File) 
